import meter1 from "../assets/img/meter1.svg";
import meter2 from "../assets/img/meter2.svg";
import meter3 from "../assets/img/meter3.svg";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import arrow1 from "../assets/img/arrow1.svg";
import arrow2 from "../assets/img/arrow2.svg";
import colorSharp from "../assets/img/color-sharp.png"

export const Internships = () => {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return (
    <section className="internships" id="internships">
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <div className="internships-bx wow zoomIn">
                        <h2>Internships</h2>
                        <p>I possess a diverse set of tech skills that reflect my commitment to mastering both foundational and advanced concepts in technology. My expertise includes proficiency in programming languages such as JavaScript, Python, and SQL, which I leverage to build and optimize applications. I am well-versed in modern web development frameworks like React and Node.js, enabling me to create responsive and efficient user interfaces. Additionally, I have hands-on experience with machine learning algorithms and data analysis, allowing me to develop predictive models and gain valuable insights from data. My skill set is complemented by a strong understanding of version control systems, cloud platforms, and agile methodologies, which support my ability to deliver high-quality solutions in collaborative environments.</p>
                        <Carousel responsive={responsive} infinite={true} className="owl-carousel owl-theme skill-slider">

                        </Carousel>
                    </div>
                </div>
            </div>
        </div>
        <img className="background-image-left" src={colorSharp} alt="Image" />
    </section>
  )
}
